import React from "react";
import iconLeft from "./assets/icon-arrow-left.svg";
function Error() {
  return (
    <>
      <h1>Error!</h1>;
      <Link to="/" className="back">
        <img src={iconLeft} alt="" />
        <h3>Go back</h3>
      </Link>
    </>
  );
}

export default Error;
